// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

import "./CarStruct.sol";

contract CarNFT is ERC721, Ownable {

    mapping(uint256 => Car) public cars;
    uint256 public totalSupply; // Counter to track total minted tokens

    // Constructor that passes arguments to both ERC721 and Ownable
    constructor(string memory name, string memory symbol) ERC721(name, symbol) Ownable(msg.sender) {
        totalSupply = 0; // Initialize totalSupply
    }

    function mintCarNFT(
        address to,
        string memory model,
        string memory color,
        uint16 yearOfMatriculation,
        uint256 originalValue,
        uint256 mileage
    ) public onlyOwner {
        totalSupply += 1; // Increment totalSupply when a new NFT is minted
        uint256 tokenId = totalSupply; // Use totalSupply as the token ID
        cars[tokenId] = Car(model, color, yearOfMatriculation, originalValue, mileage);
        _safeMint(to, tokenId);
    }

    function calculateMonthlyQuota(
        uint256 originalValue,
        uint256 currentMileage,
        uint8 driverExperienceYears,
        uint256 mileageCap,
        uint256 contractDuration
    ) public pure returns (uint256) {
        // Example computation formula
        uint256 baseRate = originalValue / 100; // Base rate as a percentage of the original value
        uint256 mileageFactor = currentMileage / mileageCap; // Mileage affects cost
        uint256 experienceFactor = driverExperienceYears > 5 ? 10 : 20; // Less cost for experienced drivers
        uint256 durationFactor = contractDuration / 12; // Longer contracts may reduce cost

        uint256 quota = baseRate + mileageFactor + experienceFactor + durationFactor;
        return quota;
    }

    function getCarByCarID(uint256 carId) public view returns (Car memory) {
        require(cars[carId].yearOfMatriculation == 0, "CarNFT: Car does not exist");
        return cars[carId];  // Return the Car struct from the cars mapping
    }


}

