// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

// Define the Car struct in its own file without a contract
struct Car {
    string model;
    string color;
    uint16 yearOfMatriculation;
    uint256 originalValue;
    uint256 mileage;
}

